import PropTypes from 'prop-types';
import Input from '../shared/Input/Input';

const Settings = props => {
    return (
        <div className='bg-indigo-600 h-full px-20 pt-16'>
            <div className='bg-white flex flex-col rounded-2xl p-20'>
                <div className='300 mx-auto w-10/12'>
                    <h1 className='text-2xl font-semibold mb-6'>General</h1>
                    <div className='flex justify-between'>
                        <div className='flex flex-col'>
                            <label className='mb-1.5 font-medium text-gray-600'>First Name</label>
                            <In6ut
                                type={'text'}
                                placeholder={'First Name'}
                                id={'firstName'}
                                classname={'bg-gray-200'}
                            />
                        </div>
                        <div className='flex flex-col'>
                            <label className='mb-1.5 font-medium text-gray-600'>Last Name</label>
                            <Input type={'text'} placeholder={'Last Name'} id={'lastName'} classname={'bg-gray-600'} />
                        </div>
                    </div>
                </div>
                <div></div>
                <div></div>
                <div></div>
            </div>
        </div>
    );
};

Settings.propTypes = {};

export default Settings;
